                <h1 id="introduction">Introduction</h1>
<p>RSIA Api adalah API yang digunakan untuk mengakses data dari RSIA, yang mencakup data pasien, dokter, dan pegawai (untuk saat ini).</p>
<aside>
    <strong>Base URL</strong>: <code>http://localhost/rsiapi</code>
</aside>
<p>Dokumentasi ini bertujuan untuk memberikan semua informasi yang Anda perlukan untuk bekerja dengan API kami</p>
<aside>
Semua endpoint yang terdapat pada dokumentasi ini hanya dapat diakses oleh user yang terdaftar dan memiliki akses ke endpoint tersebut. Namun pada dasarnya perbedaan role atau <b>jabatan</b> pada kasus nyata, mempengaruhi aksesibilitas endpoint yang dapat diakses oleh user tersebut.
</aside>

                <h1 id="authenticating-requests">Authenticating requests</h1>
<p>Untuk mengautentikasi permintaan, sertakan header <strong><code>Authorization</code></strong> dengan nilai <strong><code>"Bearer {YOUR_JWT_TOKEN}"</code></strong>.</p>
<!-- tulis text diatas kedalam bahasa indonesia dibawah ini -->
<p>Semua titik akhir yang diautentikasi ditandai dengan lencana <code>requires authentication</code> dalam dokumentasi di bawah.</p>
            </div>
